import React from 'react';
import { ServHead } from './components/header';
import { NavLink } from 'react-router-dom';
import { Main } from './components';
import { Bg } from './components/components';

export const Services = () => (
	<main>
		<ServHead />
		<Main>
			<div className="dt hide-child br2 cover bg-center">
				<img src="" alt=""/>
				<span className="white dtc v-mid w-100 h-100 child bg-black-40 pa5">
					Card title
				</span>
			</div>
		</Main>
	</main>
);
